function note(props) {
  return ( < div className = "note" > < body >
    <
    h1 className = "name heading" > {
      props.name
    } < /h1> <
    div className = "info card" >
    <
    img className = "circle-img"
    src = {
      props.image
    }
    alt = "celebrity-img" / >
    <
    p className = "" > {
      props.tel
    } < /p > <
    p className = "" > {
      props.email
    } < /p > < /
    div > < /body> <
    /div>);
  }

  export default note;
